sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'zone', 'instance', 'labelFingerprint']);
    gcc.maptoOutputFromInput(inputs, outputs, ['projectid', 'zone', 'instance']);
    var requestBody = {
        "labelFingerprint": inputs.labelFingerprint
    }
    if (inputs.labels.length > 0) {
        var labels = {};
        var isValidlabels = false;
        inputs.labels.forEach(function(label) {
            if (label['key'].trim() && label['value'].trim()) {
                isValidlabels = true;
                labels[label['key']] = label['value'];
            }
        });
        if (!isValidlabels)
            throw new Error("Labels are not entered");
        requestBody.labels = labels;
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

